export default function Page({children,cool}){
    return <div>
        <p>I am the page.</p>
        <h3>{cool}</h3>
        {children}
    </div>
}

Page.propTypes = {
    cool:propTypes.string,
    children:PropTypes.arrayOf(PropTypes.node),
}
